import React from "react";
import "./Banner.css";

const Banner = () => {
    return (
        <div className="banner-img">
            <div className="banner-text">
                <h1>TRAVEL | <span>PASS</span> </h1>
                <p>
                    Luxury travel with no nightly rates, taxes, or fees
                </p>
            </div>
        </div>
    );
};

export default Banner;
